import {
  Box,
  Heading,
  HStack,
  Image,
  Spacer,
  Stack,
  Text,
} from "@chakra-ui/react";

const Home = () => {
  return (
    <Stack spacing="15%" ml="10" direction="row">
      <Heading mt="15%" as="h1" size="4xl">
        the best casting agent
      </Heading>
      <Text>we find the perfect cast for your movie</Text>
      <Box>
        <Image
          mt="40%"
          boxSize="600px"
          objectFit="contain"
          src="pana.png"
        ></Image>
      </Box>
    </Stack>
  );
};

export default Home;
